description:
smart Kanji is a dynamic learning method of Japanese kanjis that adapts to the user's theme and provides him the most optimal learning course.

In this N5 edition (beginner level), learn 140 kanjis and about 300 words ! All you need to pass the kanji part of the Japanese Language Proficiency Test (JLPT) N5
